import React from "react";
import PropTypes from "prop-types";

const Modal = ({selectedImage}) => {
  return (
    <>
      {selectedImage}
    </>
  );
};


Modal.propTypes = {
  selectedImage: PropTypes.shape({
    id: PropTypes.string,
    url: PropTypes.string,
  }),
};

Modal.defaultProps = {
  selectedImage: {},
};

export default Modal;
